window.bookSummaryJSON = "<p>The newest installment in the Mafia-themed contemporary romance series the Eagle Elite by <i>New York Times</i> best-selling author Rachel Van Dyken. </p> <p>There are two sides to every story, and theirs isn't pretty, but then again, what's pretty about the Mafia? Trace Rooks, that's what. But she wants only one of them, and he'll kill the other before he lets him have her. The only problem is that they're cousins - and she may just be their long-lost enemy. Whoever said college was hard clearly didn't attend Eagle Elite University. </p> <p>Welcome to hell, also known as the Mafia, where blood is thicker than life, and to keep yours, you must keep your friends close - and your enemies even closer. </p>"; 
